import urlJoin from "url-join";
import { httpPostSimple } from "./makeRequest.js";
/**
 * Get data for all the feeds. Optionally upload new feeds or update existing feeds.
 *
 * This endpoint is only available to authenticated admin users.
 */
export async function requestFrogCryptoUpdateFeeds(zupassServerUrl, req) {
    return httpPostSimple(urlJoin(zupassServerUrl, "/frogcrypto/admin/feeds"), async (resText) => ({
        value: JSON.parse(resText),
        success: true
    }), req);
}
